    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <div>
          Hello my name is Bernard
        </div>
        <div>
          <Timedisplay/>
        </div>
      </header>
    </div>
  );
}

export default App;
